--promjene za festivale za dobar unos iz mockaroo-a
ALTER TABLE Festivals
	RENAME COLUMN StartDate TO start_date;

ALTER TABLE Festivals
	ALTER COLUMN FestivalName TYPE VARCHAR(100),
	ALTER COLUMN City TYPE VARCHAR(100);


CREATE OR REPLACE FUNCTION Set_Festival_Status()
	RETURNS TRIGGER
AS
$$
	BEGIN
	IF(NEW.EndDate < CURRENT_DATE) THEN
		NEW.Status = 'completed';
	ELSIF(NEW.start_date > CURRENT_DATE) THEN
		NEW.Status = 'planned';
	ELSIF(NEW.start_date < CURRENT_DATE AND NEW.EndDate> CURRENT_DATE) THEN
		NEW.Status = 'active';
	END IF;
	RETURN NEW;
	END;
$$
language plpgsql;

CREATE TRIGGER Festival_Status
	BEFORE INSERT OR UPDATE ON Festivals
	FOR EACH ROW
	EXECUTE FUNCTION Set_Festival_Status();

--promjene za stages za dobar unos iz mockaroo-a
ALTER TABLE Stages
	ALTER COLUMN StageName TYPE VARCHAR(200),
	ADD CONSTRAINT unique_stage_per_festival
	UNIQUE (StageName, FestivalId);




